import styled from "styled-components"

export const ArticlePage = styled.section`
	display: flex;
	flex-direction: column;
	align-items: center;
	justify-content: center;
  width:100%;
`

export const Header = styled.h1`
	display:flex;
	flex-direction: column;
	align-items: center;
	justify-content: center;
	font-weight:100;
	font-size:46px;

	small {
		font-size:1.2rem;
	}
`

export const Content = styled.div`
	max-width: 60rem;
`
